require('dotenv')({});
import axios from 'axios';

export const loginUser = (pEmail, pPassword) => {
    var response = axios.post(`${process.env.BASE_API_URL}/v1/users/login`, {
        email: pEmail,
        password: pPassword
    }, 
    {
        headers: {
           // 'x-access-token': '',
            'Content-Type': 'application/x-www-form-urlencoded'
        },
        json: true
    });

    return response;
};

